import Vue from 'vue'
import Router from 'vue-router'
import rte from './view/RoutePage/Route'
import equipment from './view/EquipmentPage/equipment'
import ds from './view/DSPage/ds'
import behavior from './view/behaviorPage/behavior'

Vue.use(Router)
var router = new Router({
    routes:[{
        path: '/',
        name: 'rte',
        component: rte,
    },
    {
        path: '/equipment',
        name: 'equipment',
        component: () => import('./view/EquipmentPage/equipment.vue')//路由间共用组件
    },
    {
        path: '/ds',
        name: 'ds',
        component: () => import('./view/DSPage/ds.vue')
    },
    {
        path: '/behavior',
        name: 'behavior',
        component: () => import('./view/behaviorPage/behavior.vue')
    }
    ]
})
export default router
